import { takeLatest, put, takeEvery } from 'redux-saga/effects'
import { getAllStore } from '../../servicce/storeService'
import { GET_ALL_STORE_SAGA } from '../type/StoreType'

function* getAllStoreSaga(action) {
    try {
        const promise = yield getAllStore()
        console.log(promise)
    } catch (err) {

    }
}


export function* storeSaga() {
    yield takeLatest(GET_ALL_STORE_SAGA, getAllStoreSaga)

}
